script: |
  super -f text -I q616.spq | sort > q616.out

inputs:
  - name: q616.spq
    data: |
      SELECT - + 79 * - col2 + + - col0 + + col1 * col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE ( - + CAST ( - col0 AS INTEGER ) ) BETWEEN ( + col0 ) AND + col0 AND NOT - 2 IS NOT NULL;
  - name: tab1

outputs:
  - name: q616.out
    data: |
